import React, { Component } from "react";

class SignedIn extends Component {
  state = {
    profilePic: []
  };
  render() {
    return (
      <nav className="container">
        <ul>
          <li>Overview</li>
          <li>Analytics</li>
          <li>Catalog</li>
          <li>Pricing</li>
          <li>Transactions</li>

          <div>
            <button>Upload Content</button>
            <img src={this.state.profilePic} alt="Profile Pic" />
          </div>
        </ul>
      </nav>
    );
  }
}

export default SignedIn;
